import Input from "components/Input"
import Icon from "components/Icon"

interface Props {
	value: string,
	onChangeInput(search: string): void,
	isSearchedAvailable: boolean
}

const SearchInput: React.FC<Props> = (props) => {
	const { isSearchedAvailable } = props
	console.log({ isSearchedAvailable })
	return (
		<div className='search-div'>
			<Input placeholder='Search books, genres, authors, etc.' className='search-input' type="text"  {...props} />
			{isSearchedAvailable ?
				<div className='ip-ic-div times'>
					&times;
				</div> :
				<div className='ip-ic-div'>
					<Icon id="search" height={15} width={15} />
				</div>
			}
		</div>
	)
}

export default SearchInput
